import { Routes, Route, Navigate } from 'react-router-dom';
import Landing from '../pages/Landing';
import Login from '../pages/auth/Login';
import Register from '../pages/auth/Register';

// Customer Pages
import Dashboard from '../pages/customer/Dashboard';
import RequestFuel from '../pages/customer/RequestFuel';
import TrackOrder from '../pages/customer/TrackOrder';
import Rewards from '../pages/customer/Rewards';
import Profile from '../pages/customer/Profile';

// Partner Pages
import PartnerDashboard from '../pages/partner/PartnerDashboard';
import RequestDetails from '../pages/partner/RequestDetails';
import DeliveryTracking from '../pages/partner/DeliveryTracking';
import Earnings from '../pages/partner/Earnings';

// Admin Pages
import AdminDashboard from '../pages/admin/AdminDashboard';
import ManageRequests from '../pages/admin/ManageRequests';
import ManageUsers from '../pages/admin/ManageUsers';
import ManageStations from '../pages/admin/ManageStations';
import Reports from '../pages/admin/Reports';

// Context
import { useAuth } from '../hooks/useAuth';

const AppRoutes = () => {
  const { user } = useAuth(); // Assuming you have an auth hook/context

  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/" element={<Landing />} />
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />

      {/* Protected Routes */}
      {user && user.role === 'customer' && (
        <>
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/request-fuel" element={<RequestFuel />} />
          <Route path="/track-order" element={<TrackOrder />} />
          <Route path="/rewards" element={<Rewards />} />
          <Route path="/profile" element={<Profile />} />
        </>
      )}

      {user && user.role === 'partner' && (
        <>
          <Route path="/partner-dashboard" element={<PartnerDashboard />} />
          <Route path="/request-details" element={<RequestDetails />} />
          <Route path="/delivery-tracking" element={<DeliveryTracking />} />
          <Route path="/earnings" element={<Earnings />} />
        </>
      )}

      {user && user.role === 'admin' && (
        <>
          <Route path="/admin-dashboard" element={<AdminDashboard />} />
          <Route path="/manage-requests" element={<ManageRequests />} />
          <Route path="/manage-users" element={<ManageUsers />} />
          <Route path="/manage-stations" element={<ManageStations />} />
          <Route path="/reports" element={<Reports />} />
        </>
      )}

      {/* Fallback if route not found */}
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
};

export default AppRoutes;
